import React from 'react';
import Fade from 'react-reveal/Fade';
const Footer = () => {
    return (
        <footer className="bck_white">
            <Fade delay={500}>
                <div className="font_quicksand footer_logo_venue">MENT</div>
                <div className="footer_copyright">MENT 2019. Todos los derechos reservados.

                </div>
            </Fade>
        </footer>
    );
};

export default Footer;
